Docs.summary:
Not used if the AP bandwidth is 20 MHz
            If the AP use 40, 80, 160 or 320MHz, this is the center frequency (in MHz)
            if the AP use 80 + 80 MHz, this is the center frequency of the first segment (in MHz)

